import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";

const cardData = [
    { title: 'Card 1', image: 'https://files.thesirona.com/site-images/400x400/medium-menstrual-cup-listing-00.jpg', description: 'Description for card 1' },
    { title: 'Card 2', image: 'https://files.thesirona.com/site-images/400x400/bum-cream-1_1.png', description: 'Description for card 2' },
    { title: 'Card 3', image: "https://files.thesirona.com/site-images/400x400/Exfoliating-Facewash_2.jpg", description: 'Description for card 3' },
    { title: 'Card 4', image: "https://files.thesirona.com/site-images/400x400/Period-Stain-Remover-1.jpg", description: 'Description for card 4' },
    { title: 'Card 5', image: 'https://picsum.photos/200/300', description: 'Description for card 5' }
  ];
  
<Carousel>
  additionalTransfrom={0}
  arrows
  autoPlaySpeed={3000}
  centerMode={false}
  className=""
  containerClass="container"
  dotListClass=""
  draggable
  focusOnSelect={false}
  infinite
  itemClass=""
  keyBoardControl
  minimumTouchDrag={80}
  renderButtonGroupOutside={false}
  renderDotsOutside={false}
  responsive={{
    desktop: {
      breakpoint: {
        max: 3000,
        min: 1024
      },
      items: 3,
      paritialVisibilityGutter: 40
    },
    mobile: {
      breakpoint: {
        max: 464,
        min: 0
      },
      items: 1,
      paritialVisibilityGutter: 30
    },
    tablet: {
       breakpoint: {
         max: 1024,
         min: 464
       },
       items: 2,
       paritialVisibilityGutter: 30
     }
   }}
   showDots
   sliderClass=""
   slidesToSlide={1}
   swipeable
   </Carousel>
